                    <img src={profPic} alt="" className="profImage"></img>
                </div>
            </div>
            <NavList/>
            <div className="dataBox">
              {/*<PersonalDetails/>*/}
                <FamilyDetails/>
            </div>
        </div>

        )
    }
}

